der leaves and a few mint leaves.','Two medium-sized chapatis with either rajma, chole, or vegetable curry. Use carrot, cauliflower, capsicum, brinjal, okra, etc.for veg curry.','Green tea without sugar or artificial sweeteners. You can have one small bowl of bhel puri or baked snacks.','Two medium-sized chapatis, any vegetable curry (any type of gourd, brinjal, capsicum, etc.) except root vegetables and one small bowl of curd.','One glass of warm milk with a pinch of raw ground turmeric.',60),(6,'Warm water with lemon juice.','One small bowl of flaked rice with milk and banana (without sugar).','One apple or orange or papaya (if fruit is not included in breakfast).','Two medium-sized chapatis with vegetables such as peas, cauliflower, capsicum, any gourd, green beans, etc. and one small bowl daal.','Masala puffed rice and green tea.','Two chapatis and one medium-sized bowl of daal.','One glass of warm milk or one bowl of curd.',70),(7,'Black coffee and digestive biscuits.','Two to three idlis with chutney and sambar (use less salt).','One orange or grapes and a glass of buttermilk.','One bowl of rice and sambar with lots of vegetables. One bowl of curd.','Green tea with roasted flaked rice with curry leaves and chopped garlic.','Vegetable clear soup or chicken and veg clear soup and two chapatis.','One glass buttermilk.',80),(8,'Lime, honey, and warm water detox drink.','Wheat flakes and milk.','One bowl of curd.','Two chapatis and vegetable curry.','Green tea and two digestive biscuits.','Vegetable curry, two chapatis, and one bowl of curd.','One glass of warm milk.',90);
